import React, { useState } from 'react';
import bigInt from 'big-integer';

function isPrime(n) {
    if (n.lesser(bigInt(2))) {
        return false;
    }
    for (let i = bigInt(2); i.lesserOrEquals(intSqrt(n)); i = i.add(1)) {
        if (n.mod(i).equals(bigInt(0))) {
            return false;
        }
    }
    return true;
}

// Функция для вычисления целочисленного квадратного корня
function intSqrt(n) {
    let x = n;
    let y = x.add(bigInt(1)).divide(bigInt(2));
    while (y.lesser(x)) {
        x = y;
        y = n.divide(x).add(x).divide(bigInt(2));
    }
    return x;
}

function Up(base, exponent, modulus) {
    base = base.mod(modulus);
    let result = bigInt(1);

    while (exponent.greater(bigInt(0))) {
        if (exponent.mod(bigInt(2)).equals(bigInt(1))) {
            result = result.multiply(base).mod(modulus);
        }
        base = base.multiply(base).mod(modulus);
        exponent = exponent.divide(bigInt(2));
    }

    return result;
}

function getRandomNumber(min, max) {
    return bigInt(Math.floor(Math.random() * (max - min + 1)) + min);
}

// Функция для нахождения расширенного НОД
function extendedGCD(a, b) {
    if (b.equals(bigInt(0))) {
        return [a, bigInt(1), bigInt(0)];
    }
    const [gcd, x1, y1] = extendedGCD(b, a.mod(b));
    const x = y1;
    const y = x1.subtract(a.divide(b).multiply(y1));
    return [gcd, x, y];
}

// Функция для нахождения обратного элемента
function modInverse(a, m) {
    const [gcd, x, y] = extendedGCD(a, m);
    if (!gcd.equals(bigInt(1))) {
        throw new Error("Обратный элемент не существует");
    }
    return x.mod(m).add(m).mod(m);
}

// Функция для случайного выбора e
function getRandomE(phi) {
    let e;
    do {
        e = getRandomNumber(bigInt(2), phi.subtract(bigInt(1)));
    } while (!extendedGCD(e, phi)[0].equals(bigInt(1))); // Убедимся, что e и phi взаимно просты
    return e;
}

const App = () => {
    const [p, setP] = useState(bigInt(0));
    const [q, setQ] = useState(bigInt(0));
    const [publicKey, setPublicKey] = useState('');
    const [privateKey, setPrivateKey] = useState('');
    const [loading, setLoading] = useState(false);

    const handleGenerateKeys = async () => {
        setLoading(true);
        let pValue = bigInt(0);
        while (!isPrime(pValue)) {
            pValue = getRandomNumber(bigInt(2).pow(40), bigInt(2).pow(50).subtract(bigInt(1))); // Генерация 128-битного простого числа
        }
        let qValue = bigInt(0);
        while (!isPrime(qValue) || pValue.equals(qValue)) {
            qValue = getRandomNumber(bigInt(2).pow(40), bigInt(2).pow(50).subtract(bigInt(1)));
        }

        const n = pValue.multiply(qValue);
        const phi = (pValue.subtract(bigInt(1))).multiply(qValue.subtract(bigInt(1)));
        const e = getRandomE(phi); // Случайный выбор e
        const d = modInverse(e, phi);

        setP(pValue);
        setQ(qValue);
        setPublicKey(`(${e}, ${n})`); // Открытый ключ: (e, n)
        setPrivateKey(`(${d}, ${n})`); // Закрытый ключ: (d, n)

        // Отправка открытого ключа на сервер
        try {
            const response = await fetch('http://localhost:5000/generate_key', {
                method: 'POST',
                headers: {
                    'Content-Type': 'application/json',
                },
                body: JSON.stringify({ publicKey: { e: e.toString(), n: n.toString() } }),
            });

            if (!response.ok) {
                throw new Error('Ошибка при отправке ключа');
            }

            const result = await response.json();
            console.log('Ответ сервера:', result);
            console.log(Up(result.public.chipher, d, n));
        } catch (error) {
            console.error('Ошибка:', error);
        }

        setLoading(false);
    };

    return (
        <div>
            <h1>Генератор ключей RSA</h1>
            <button onClick={handleGenerateKeys} disabled={loading}>
                {loading ? 'Генерация...' : 'Сгенерировать ключи'}
            </button>
            <h2>Случайные простые числа:</h2>
            <p>p: {p.toString()}</p>
            <p>q: {q.toString()}</p>
            <h2>Публичный ключ:</h2>
            <p>{publicKey}</p>
            <h2>Приватный ключ:</h2>
            <p>{privateKey}</p>
        </div>
    );
};

export default App;
